const UploadForm = () => {
  return (
    <div className="container mt-5">
      <h2 className="text-primary">Upload Your Credential</h2>
      <form className="mt-3">
        <input type="file" className="form-control" />
        <button type="submit" className="btn btn-success mt-3 w-100">Upload</button>
      </form>
    </div>
  );
};

export default UploadForm; // ✅ Make sure this is here!
